    {
        path:"/discover",
        component:Discover
    },
    {
        path: "/mine",
        component: Mine
    },
    {
        path: "/friend",
        component: Friend
    },
    {
        path: '/', 
        exact: true, 
        render: () => <Redirect to="/discover" /> 
    }
